   "source": [
    "#results for a verified place to stay for a minimum of 7 days in Midtown, Manhattan for under $500\n",
    "airbnb%>%\n",
    "select(id,host_validity, price, service_fee, min_nights, room_type, borough, neighborhood)%>%\n",
    "filter(host_validity == \"verified\", room_type == \"Entire home/apt\", \n",
    "       min_nights ==7, borough != \"na\", neighborhood == \"Midtown\")%>%\n",
    "mutate(total_price = price * min_nights + service_fee)%>%\n",
    "filter(total_price <= 500)%>%\n",
    "arrange(min_nights,desc(total_price))\n"
   ]
