   "source": [
    "#average cost of a verified entire home/apt in Brooklyn for a minimum 10 night stay \n",
    "verified_brooklyn_prices <- airbnb%>%\n",
    "select(host_validity, price, service_fee, min_nights, room_type, borough, neighborhood)%>%\n",
    "filter(host_validity == \"verified\", room_type == \"Entire home/apt\", min_nights == 10, \n",
    "       borough == \"Brooklyn\", price > 1, service_fee > 1)%>%\n",
    "mutate(total_price = price * min_nights + service_fee)%>%\n",
    "group_by(neighborhood, host_validity)%>%\n",
    "summarize(average_price = mean(total_price))%>%\n",
    "arrange(average_price)\n",
    "verified_brooklyn_prices"
   ]
  },
