   "source": [
    "unconfirm_brooklyn_prices <- airbnb%>%\n",
    "select(host_validity, price, service_fee, min_nights, room_type, borough, neighborhood)%>%\n",
    "filter(host_validity == \"unconfirmed\", min_nights == 10, \n",
    "       borough == \"Brooklyn\", price > 1, service_fee > 1)%>%\n",
    "mutate(total_price = price * min_nights + service_fee)%>%\n",
    "group_by(neighborhood)%>%\n",
    "arrange(total_price)\n",
    "unconfirm_brooklyn_prices"
   ]
  },
